import React from 'react';

const Results = ({ dates, airports, cities }) => {
  return (
    <div>
      <h2>Results</h2>
      <p>Departure: {dates.departure}</p>
      <p>Return: {dates.return}</p>
      <p>Flexibility: {dates.flexibility} days</p>
      <p>Selected Airports: {airports.join(', ')}</p>
      <p>Cities to Visit: {cities.join(', ')}</p>
    </div>
  );
};

export default Results;
